//     pv: 4300,
//     amt: 2100
//   }
// ];

const SignUpAreaChart = ({ data }: any) => {
  console.log("react", React);
  return (
    <AreaChart
      width={500}
      height={400}
      data={data}
      margin={{
        top: 10,
        right: 30,
        left: 0,
        bottom: 0
      }}
    >
      <CartesianGrid strokeDasharray="3 3" />
      <XAxis dataKey="name" />
      <YAxis />
      <Tooltip />
      <Area type="monotone" dataKey="count" stroke="#8884d8" fill="#8884d8" />
    </AreaChart>
  );
};

export default SignUpAreaChart;
